  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Bowdoin
  NWR outlines Refuge accomplishments from February through April of 1941. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and wildfires. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses. N-R forms, updates on the easement
  refuges, photographs, and newspaper articles are attached.\",\n\t\"owner_org\":
